import React from 'react';
import { Grid } from '@material-ui/core';
// import Paper from '@mui/material/Paper';
// import { styled } from '@mui/material/styles';


import CarDetail from './carDetail';



const Home = () => {
    return (
        <>
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <CarDetail />
                </Grid>
            </Grid>

        </>
    )

}

export default Home;
